def first(n):
    t = []
    q = 0
    for i in range(1, n+1):
        if i % 7 == 0 or "7" in str(i):
            q += 1
            t.append(t[q-1])
        else:
            t.append(i)
    return(t) # _David A. Corneth_, Jul 10 2025

